import styles from './Simple.module.css';

const Simple = (props) => {
    if(props.price===true){
  return (
    <>
    <div className={styles.card}>
        <img src={props.img}alt=""/>
        <h1>{props.name}</h1>
        <p>{props.place}</p>
        <p>{props.mantra}</p>
        <p>{props.show}</p>
    </div>
    </>
  )

}
}

export default Simple
